import React from "react";
import { Row, Col, Divider, Icon, Card, Avatar } from "antd";
const { Meta } = Card;
const ListCard = ({ data, handleDelete, handleShowModal }) => {
  return (
    <Row gutter={2}>
      <Divider />

      {data.map(a => (
        <Col span={6}>
          <Card
            key={a.id}
            id={a.id}
            style={{ width: 300, margin: "1em 2em" }}
            title={a.table_number}
            cover={<img alt="" src={a.url} />}
            actions={[
              <Icon type="delete" onClick={() => handleDelete(a.id)} />,
              <Icon type="edit" onClick={() => handleShowModal(a)} />
            ]}
          >
            <Meta
              avatar={<Avatar>{a.name}</Avatar>}
              title={a.name}
              description={a.order}
            />
          </Card>
        </Col>
      ))}
    </Row>
  );
};

export default ListCard;
